        tmp_184_reg_1460 = mul9_fu_1148_p2.read().range(17, 10);
        tmp_187_reg_1465 = tmp_187_fu_1186_p1.read();
        tmp_188_reg_1470 = tmp_188_fu_1190_p1.read().range(7, 7);
